import React from 'react';
import './App.css';
import SimpleTabs from './Menu';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles({
  root: {
    background: '#424242',
  },
});

function App() {
  const classes = useStyles();
  return (
    <div className={classes.root}>
      <SimpleTabs/>
    </div>
  );
}

export default App;
